import React, { useEffect, useRef } from "react";
import * as d3 from "d3";
import axios from "axios";

const AnalyticsChart = () => {
  const chartRef = useRef();

  useEffect(() => {
    // Fetch data from API
    const fetchData = async () => {
      try {
        const response = await axios.get("http://localhost/caf-old-setup/wp-json/tp/v1/post-views");
        const data = response.data; // Assume it's an array of { date, views }

        // Prepare data for the chart
        const formattedData = data.map((item) => ({
          date: new Date(item.date),
          views: item.views,
        }));

        // Render the bar chart
        renderChart(formattedData);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []);

  const renderChart = (data) => {
    // Chart dimensions
    const width = 800;
    const height = 400;
    const margin = { top: 20, right: 30, bottom: 50, left: 50 };

    // Clear any existing chart
    d3.select(chartRef.current).select("svg").remove();

    // Create the SVG canvas
    const svg = d3
      .select(chartRef.current)
      .append("svg")
      .attr("width", width)
      .attr("height", height);

    // Set up scales
    const xScale = d3
      .scaleBand()
      .domain(data.map((d) => d.date))
      .range([margin.left, width - margin.right])
      .padding(0.1);

    const yScale = d3
      .scaleLinear()
      .domain([0, d3.max(data, (d) => d.views)])
      .nice()
      .range([height - margin.bottom, margin.top]);

    // Add axes
    svg
      .append("g")
      .attr("transform", `translate(0, ${height - margin.bottom})`)
      .call(
        d3.axisBottom(xScale).tickFormat(d3.timeFormat("%b %d")) // Format dates as "Month Day"
      )
      .selectAll("text")
      .attr("transform", "rotate(-45)") // Rotate axis labels for better readability
      .style("text-anchor", "end");

    svg
      .append("g")
      .attr("transform", `translate(${margin.left}, 0)`)
      .call(d3.axisLeft(yScale));

    // Add bars
    svg
      .selectAll(".bar")
      .data(data)
      .join("rect")
      .attr("class", "bar")
      .attr("x", (d) => xScale(d.date))
      .attr("y", (d) => yScale(d.views))
      .attr("width", xScale.bandwidth())
      .attr("height", (d) => height - margin.bottom - yScale(d.views))
      .attr("fill", "steelblue");
  };

  return <div ref={chartRef}></div>;
};

export default AnalyticsChart;
